//Login Screen ટેલીકોલર એપ વપરાશકર્તા નામ પાસવર્ડ એડમિન પાસવર્ડ પ્રવેશ કરો સાઇન ઇન કરો તમારો URL તપાસો ભિન્ન ઉપસર્ગ પસંદ કરો! આ વપરાશકર્તા નામ અમાન્ય છે આ પાસવર્ડ ખૂબ નાનો છે યુસરનેમ અને પાસવર્ડ ઉમેરો આ ક્ષેત્ર જરૂરી છે નેટવર્ક ક્ષતિ કૃપા કરીને સ્થાન ડ્રોપડાઉનનું મૂલ્ય પસંદ કરો સ્થાનો લાવવામાં અસમર્થ ઇમેઇલ પૂર્ણતા પ્રદાન કરવા માટે સંપર્કોની પરવાનગીની આવશ્યકતા છે. ડીવાઇસ આઇ.ડી પ્રવેશ કરી શકતા નથી કૃપા કરીને તમારો પાસવર્ડ ફરીથી સેટ કરવા માટે તમારા સિસ્ટમ સંચાલકનો સંપર્ક કરો અથવા support@intelehealth.io પર ઇમેઇલ મોકલો કૃપા કરીને તમારો પાસવર્ડ ફરીથી સેટ કરવા માટે તમારા સિસ્ટમ સંચાલકનો સંપર્ક કરો
//Home Screen (after login) મુખ્ય પેજ નવા દર્દી દર્દી શોધો નિદાન/પરિક્ષણો સક્રીય દર્દી ડેટા રિફ્રેશ કરો સેટીંગ દિવસને અંતે લોગઆઉટ
//Identification Screen નવા દર્દીને ઉમેરો નામ* પિતા/માતા/પતિનું નામ અટક* સરનામું 1 સરનામું 2 ફોન નંબર* એડમીન પાસવર્ડ એંટર કરો લિંગ* પુરૂષ સ્ત્રી જન્મતારીખ* વય(ઉમર) સમય: શહેર ગામ* રાજ્ય તાલુકો* જાતી આર્થીક સ્થિતિ અભ્યાસ દેશ* પિનકોડ ના પુત્ર/પુત્રી/પત્ની વ્યવસાય દર્દીની નોંધણી થઇ ગયેલ છે! સર્વર ઉપર અપલોડ થઇ રહેલ છે ખામીઃ ડેટા ફીલ્ડ યોગ્ય રીતે ફૉર્મેટ થયા નથી કૃપયા વર્ષ મા ઉમર દર્જ કરો આજની તારીખ મુજબ જન્મ તારીખ સ્ટ કરેલ છે. જાતી પસંદ કરેલ નથી મહેરબાની કરીને બાકી રહેતા જરૂરી ફિલ્ડ પુર્ણ કરો યોગ્ય જન્મ તારીખ એંટર કરો યોગ્ય વય એંટર કરો વર્ષો મહિના વર્ષો મહિના કલાક મિનિટ
