//Question Node Screen પ્રવૃત્તીની પ્રશ્ન ગાંઠ ફેરફાર કરો શું તમને ખાતરી છે કે તમે બધા પ્રશ્નોના જવાબ આપ્યા છે કૃપા કરીને નિરિક્ષણનાં તમામ પ્રશ્નોના જવાબ આપો. મહેરબાની કરે સમયગાળો દર્શાવો ટેક્ષ્ટ ઉમેરો તારીખ પસંદ કરો સ્થળ પસંદ કરો નંબર દર્જ કરો એરીયા દર્શાવો ( લં X પ) રેંજ દર્જ કરો કેટલી વખત તે જણાવો
