//Patient Detail Screen દર્દીની માહીતી દર્દીની હીશ્ટ્રી (ઇતિહાસ/ભુતકાળની વિગતો દર્શાવવી) દર્દીની વિગતો હિશ્ટ્રી નવી મુલાકાત શરૂ કરો અગાઉની મુલાકાત મેડીકલ હિશ્ટ્રી (ઇતિહાસ/ભુતકાળની વિગતો દર્શાવવી) કૌટુંબિક હિશ્ટ્રી બિમારીની કોઇ હિશ્ટ્રી નથી દરદીની આઇડીઃ જન્મતારીખ વય(ઉમર) સરનામું ફોન નંબર મુલાકાત શરુ કરવા માટે કલીક કરો સેટીંગ
સામાન્ય સામાજિક ભલામણો શક્ય બનાવો તમારા સંદેશ ડિસ્પ્લે નામ જ્હોન સ્મિથ
ડેટા અને રિફ્રેશ સર્વર યુ.આર.એલ સ્થળ પ્રીફિક્સ
સુચનાઓ નવા મેસેજનું નોટિફિકેશન રિંગટોન શાંત -સાયલન્ટ ધ્રૂજારી-વાયબ્રેટ ઍપ્લિકેશનમાં ખામી, રિપોર્ટ મોકલાયો સેટ અપ કેમેરો આજે/આજની વિઝિટ વધારાના દસ્તાવેજો વિડીયો લાઇબ્રેરી મુલાકાતની વિગતો
સેટઅપ માટે સક્ષમ ઇંટરનેટ જરૂરી છે મેન્યુઅલ એંટ્રી ભુસી નાખો અને ફરીથી લખો વાઇટલ્સ સ્ક્રીન પરથી તમે વાઇટલ ફરી કરી શકો
//Camera Permissions કૅમેરા પ્રીવ્યૂ બતાવવા માટે કૅમેરાની મંજૂરી જોઇએ કૅમેરાની મંજૂરી ન અપાઇ. મંજૂરી આપવા વિનંતી, જેથી કૅમેરાનો ઉપયોગ કરી શકાય કૅમેરાની મંજૂરી- ક્યારેય ફરી પૂછશો નહીં-, એમ કહ્યું. મંજુરી આપો ખોટુ બરાબર રદ કર્યુ ફોટો લો ફ્લૅશ ચાલુ કરો કૅમેરા ચાલુ કરો ફ્લૅશ આપોઆપ ચાલુ કરો ફ્લૅશ બંધ ફ્લૅશ ચાલુ
//SEND SMS Permissions એસએમએસ મોકલવા માટે એસએમએસ મંજૂરી જોઇએ એસએમએસની મંજૂરી ન અપાઇ. ઍપ્લિકેશન તરફથી એસએમએસ મોકલવા માટે આ મંજૂરી આપો એસએમએસની મંજૂરી નકારાઇ- ક્યારેય ફરી પૂછશો નહીં, એમ કહ્યું. સાચવો કાઢી નાખો
//Camera Dialog પૂરતા પ્રકાશમાં જ દસ્તાવેજનો ફોટો પાડો. જો તેનો ફોટો સ્પષ્ટ દેખાતો ન હોય તો ફોટો ફરીથી પાડો.
ઓફલાઇન લોગ ઇન ઉપલબ્ધ નથી ઉપયોગકર્તા (યૂઝર) મળતા આવતા નથી. ઑફલાઇન હોવાથી પ્રમાણીકરણ કરી શકાતું નથી પ્રમાણીકરણ કરી શકાતું નથી
સ્થળ પસંદ કરો લાઇસેંસ કી ડેમો પ્રોટોકોલનો ઉપયોગ કરો પ્રોટોકોલ ડાઉનલોડ કરો
ક્રુપા કરી રાહ જુઓ પ્રોટોકોલ ડાઉનલોડ થઇ રહ્યા છે લોગીન માઇંડમેપ ડાઉનલોડ કરવામા ક્ષતી આવી છે
//Sync strings બંધ કરાયું પ્રગતિમા છે પૂરું ખામીઃ આવી કોઇ સ્થિતિ નથી
આઇડી નંબર અપલોડ થઇ રહ્યુ છે ડાઉનલોડ થઇ રહ્યુ છે
મુલાકાત મુલાકાત અદ્યતન કરો (અપડેટ) દર્દી દર્દી અપડેટ દર્દીનો ફોટો તસવીર જુઓ પ્રીસ્ક્રીપશન
કૃપા કરીને મુલાકાત સમાપ્ત કરવાનો પ્રયાસ કરતા પહેલા ડાઉનલોડ કરો. ફોન નંબર લખવો જરૂરી મુલાકાત પુર્ણ
એસએમએસ નિષ્ફળ, પછીથી ફરી પ્રયત્ન કરવા વિનંતી એસએમએસ મોકલાયો!
