પૂરી પાડવામાં આવેલ નથી
તમારો અનુભવ કેવો રહ્યો? તમારી ટિપ્પણીઓ અહીં દાખલ કરો અવગણો/છોડી દો સબમિટ કરો સબમિટ કરતા પહેલાં કૃપા કરીને સ્માઇલી પસંદ કરો
ડેટાબેસ બૅકઅપ પૂરો ડેટાબેસ રિસ્ટોર કરવાનું પૂરું
ડેટાબેસ ક્લાઉડમાં અપલોડ કરાય છે ઇન્ટરનેટ કનેક્શન ઉપલબ્ધ નથી કોઇ ડેટા બૅકઅપ નથી લોકલ બૅકઅપ ઉપલબ્ધ નથી લોકલ બૅકઅપમાંથી રિસ્ટોર કરાય છે ક્લાઉડમાંથી રિસ્ટોર કરો ડેટા રિસ્ટોર કરાય છે ડેટાબેસમાં ડેટા છે, રિસ્ટોર કરી શકાતો નથી ક્લાઉડમાંથી ડેટાબેસ ડાઉનલોડ કરાય છે ક્લાઉડમાંથી ડેટા રિસ્ટોર કરાય છે (ફોર્સ્ડ) ડેટાબેસ અપલોડ કરો ડેટાબેસ અપલોડ કરાય છે ડેટાબેસ અપલોડ કરવાનું પૂરું ડેટાબેસ અપલોડ કરવાનું નિષ્ફળ ડેટાબેસ બૅકઅપ ઉપલબ્ધ નથી બૅકઅપ ફાઇલ રાઇટ કરવામાં ખામી બૅકઅપ રિસ્ટોર કરો લોકલ બૅકઅપ મળ્યો છે. રિસ્ટોર કરવા માગો છો?
ડાઉનલોડ થઇ રહ્યું છે ઇમેજ ડેટા ડાઉનલોડ કરાય છે ઇમેજ ડેટા ડાઉનલોડ કરવાનું પૂરું બધી જ ઇમેજ ફાઇલ ડાઉનલોડ કરી દેવાઇ છે ડાઉનલોડ કરેલ છે ઇમેજ ઉપલબ્ધ નથી ઇમેજ ડાઉનલોડ નિષ્ફળ
અગાઉથી લોગ ઇન કરેલ છે અગાઉથી લોગ ઇન કરેલ છે, ક્રુપા કરી અન્ય ડિવાઇસમાથી લોગાઉટ કરો સર્વરમાંથી બહાર નીકળી ગયા લૉગઇન સફળ! આ લોકેશનમાં બીજા યૂઝરે લૉગઇન કર્યું છે. એડમિનનો સંપર્ક કરો ડિવાઇસ ઑફલાઇન. લૉગઇનની ખરાઇ માટે સર્વર તપાસી શકાતું નથી
