આર્થીક સ્થિતિ અભ્યાસ જાતી અગાઉની મુલાકાત સ્વિકારો રદ કરો આગળ તમે કયાં સર્વર સાથે જોડાવા માગો છો? યુ.આર.એલ દાખલ કરો લૉગઇન કરવા માટે લોકેશન પસંદ કરો પ્રોટોકૉલ માટે એક વિકલ્પ પસંદ કરો ક્રુપા કરી તમારો પાસવર્ડ અને યુસરનેમ ઉમેરો એન્ડ્રૉઇડ આઇડીઃ શ્વસન દર તસવીર ડાઉનલોડ કરવા ક્લીક કરો ડોકટરની વિગતો આરોગ્ય કાર્યકર પ્રાથમિકતા સરવર યુ.આર.એલ રિફ્રેશ પ્રોટોકૉલ અપડેટ કરો તમામ મુલાકાત પુર્ણ કરો બનાવનાર (ક્રિએટર) ની રીતે ફિલ્ટર કરો પ્લેનેટનું નામ બરાબર રદ કરો પૂરું કરી શકાતું નથી કૃપા કરીને મુલાકાત સમાપ્ત કરવાનો પ્રયાસ કરતા પહેલા મુલાકાત અપલોડ કરો. સક્રીય દર્દી પુર્ણ
રિફ્રેશ કરવાનું ચાલુ મહેરબાની કરી રાહ જુવો... રિફ્રેશ રિફ્રેશ બૅકગ્રાઉન્ડ પૂરું રિફ્રેશ ઉપલબ્ધ નથી ઇન્ટરનેટ કનેક્શન સાથે જોડો ઇમેજઅપલોડ ઇમેજ અપલોડ નિષ્ફળ શું તમે ખરેખર બહાર નીકળવા માંગો છો? શું તમે ખરેખર લોગઆઉટ કરવા માંગો છો? છેલ્લું રિફ્રેશ દર્દીને અપડેટ કરો શું તમે ખરેખર પાછા જવા માંગો છો? ભૂલ/ક્ષતી દરદીનો ડેટા અપલોડ કરો દરદીની ઇમેજ ડાઉનલોડ કરો \ની ઇમેજ અલોડ કરવાનું પૂરું પહેલાં કોઇ જ વિઝિટ નથી મુલાકાત પુર્ણ વિઝિટ પૂરી આ પ્રશ્નનો એક જ જવાબ હોઇ શકે ડોકટરને અપલોડ થઇ રહ્યુ છે ડેટા અપલોડની વિઝિટ કરો વિઝિટ ડેટા અપલોડ કરાય છે વિઝિટ ડેટા અપલોડ કરાય છે અપલોડ કરવાનું નિષ્ફળ અપલોડનું કામ પૂરું તમારી કનેકટીવિટી તપાસ કરો ડોકટર દ્રારા ડાઉનલોડ કરવામા આવ્યુ પ્રીસ્ક્રીપ્શન ડાઉનલોડ થઇ ગયુ છે પ્રીસ્ક્રીપ્શન ડાઉનલોડ થઇ રહ્યુ છે વિઝિટ ડેટા નિષ્ફળ દરદીનો ડેટા નિષ્ફળ ગોપનિયતા અંગે નોટીસ આ હેલ્થ વર્કર માટે કોઇ પેશન્ટ રેકૉર્ડ મળ્યો નથી રિફ્રેશ થાય છે રિફ્રેશ સફળ ભાષા હાલની ભાષા
પ્રોટોકોલ સફળતાપુર્વક ડાઉનલોડ થઇ ગયા છે પ્રોટોકોલ મળેલ નથી પ્રોટોકોલ ડાઉનલોડ કરવામાં સમસ્યા આવી, કૃપા કરીને સિસ્ટમ સંચાલકનો સંપર્ક કરો છેલ્લે રિફ્રેશ કરાયું- આજે/આજની વિઝિટ સક્રિય મુલાકાતો દિવસ કલાક મિનિટ s અગાઉ/પહેલા રિફ્રેશ સફળ ફરી સક્રીય કરવામા નિષ્ફળ, તમારું ઇન્ટરનેટ કનેક્શન તપાસો મુલાકાત અપલોડ થયેલ નથી અપલોડ થઇ રહ્યુ છે મુલાકાત સફળતાપુર્વક અપલોડ થઇ ગયેલ છે જ્યારે ઇન્ટરનેટ ઉપલબ્ધ હોય ત્યારે અપલોડ કરવામાં આવશે મુલાકાત આઇ.ડી
શું તમે ખરેખર મુલાકાત સમાપ્ત કરવા માંગો છો? પ્રિસ્ક્રિપ્શન ડાઉનલોડ થયું નથી, ઇન્ટરનેટ કનેક્શન તપાસો તમે સંમતિ વિના દર્દીની નોંધણી કરી શકતા નથી જવાબ આપ્યો નથી નવું અપડેટ ઉપલબ્ધ છે નવી સુવિધાઓ નવી સુવિધાઓ સાથે ઉપલબ્ધ છે, કૃપા કરીને એપ્લિકેશનને અપડેટ કરો અપડેટ
તમારી મુલાકાતનું કારણ શું છે? આગલા માટે અગાઉના / ઉપર માટે નીચે સ્વાઇપ કરો આગળ માટે સ્વાઇપ કરો પાછલા માટે ડાઉન સ્વાઇપ કરો શું તમારી પાસે આ લક્ષણ છે?
અંગત માહીતી સરનામુ અન્ય શુ તમારે મદદની જરૂર છે ? ક્રુપા કરી અમારો સંપર્ક કરો વોટ્સએપ હેલ્પલાઇન મદદ છોડો શરૂ કરો આ \ઍપ્લિકેશન શાના માટે છે? કસ્ટમ સેટઅપ ડેમો સંસ્કરણ નમૂના લખાણ પરીક્ષણ 2 વિભા ઓનપ્લસ 6ટી, 10એફકેઇ-7 સક્રીય દર્દી તમને આ લક્ષણો ક્યારથી હતાં? હેલો હું આયુ છું, ડિજિટલ આરોગ્ય સહાયક. ચાલો, શરુ કરીએ! હેલો હું આયુ છું, ડિજિટલ આરોગ્ય સહાયક. ચાલો, શરુ કરીએ! "હલો, મારું નામ ..છે " "અને મને થોડી મદદ જોઇએ છે" આર્થિક વિગતો ખૂટે છે શૈક્ષણિક વિગતો ખૂટે છે માયટેલિડોક, ટેલિમેડિસીન ઍપ્લિકેશન છે જે ગ્રામ અને અંતરિયાળ વિસ્તારના હેલ્થ વર્કરોને, દૂર બેઠેલા ડૉક્ટરોની સાથે જોડે છે, જેથી તેઓ પોતાના દરદીઓને ઉચ્ચ ગુણવત્તાની આરોગ્ય સેવાઓ પૂરી પાડી શકે. ટેલીકોલર એપ આયુ બંધ કરાયું "સક્રિય" સંકળાયેલ લક્ષણો ડીવાઇસ આઇ.ડી સાચું લાઇસન્સ યૂઆરએલ લખો કૃપા કરીને url અને કી દાખલ કરો વેલીડ લાયસન્સ કી દર્જ કરો મંજૂરી નકારાઇ\n જો તમે પરવાનગી નામંજૂર કરો છો, તો તમે આ સેવાનો ઉપયોગ કરી શકતા નથી /કૃપા કરીને [સેટિંગ]> [પરવાનગી]] પર જઇ પરવાનગી લો \"સમય (હાલનો) => \" "ટેમ્પરેચર(સે): " "ટેમ્પરેચર(ફે): " પરિવારમાં બીમારીની વિગતો મલેલ નથી. દરદીની બીમારીની પાછલી કોઇ વિગતો અપાઇ નથી નોંધણી નં.: ફોન નંબરઃ ઇમેલઃ મુલાકાતની વિગતો દરદીની આઇડીઃ દરદીનું નામઃ દરદીની જન્મતારીખઃ ભૂલ: દશાંશ ન હોય તેવો નંબર દાખલ કર્યો છે. પ્રોટોકોલ ડાઉનલોડ કરી રહ્યું છે માઇન્ડમૅપ ડાઉનલોડ કરવા માટે તમારી પાસે ઇન્ટરનેટ જોડાણ સુવિધા હોવી જોઇએ, તમારું ઇન્ટરનેટ ચાલુ કરો દિવસો સંપર્ક એક નવું પ્રિસ્ક્રિપ્શન મળી ગયુ છે "હલો, ઇન્ટેલહેલ્થનો ઉપયોગ કરવા બદલ આભાર.તમારું પ્રિસ્ક્રિપ્શન ડાઉનલોડ કરવા માટે અહિં ક્લિક કરો" "અને તમારી દરદી આઇડી લખો" ફાઇલ એક્સ્પ્લોરર-ઇન્ટર્નલ સ્ટોરેજ/ઇન્ટેલહેલ્થ_પીડીએફમાંથી પ્રિસ્ક્રિપ્શન પસંદ કરો વિશેષજ્ઞતા જુઓ/પ્રીંટ લો ઉંમરઃ 11 વર્ષ, 5 મહિના શેર કરો વિશેષજ્ઞતા પસંદ કરવા વિનંતી રિફ્રેશ દસ્તાવેજ- "તમારો પાસવર્ડ ઉમેરો " "તમારૂ યુસરનેમ ઉમેરો " "દર્દીનુ નામ " "વર્ષ " " મહિના" ના પુત્ર/પુત્રી/પત્ની "વ્યવસાય " રિફ્રેશ પૂરું થાય ત્યાં સુધી રાહ જોવા વિનંતી સર્વર યુ.આર.એલ લાઇસેંસ કી દાખલ કરો અમાન્ય યુ.આર.એલ કૃપા કરી કોઈ વિકલ્પ પસંદ કરો તાપમાન હમણાં રિફ્રેશ કરો ંક કરવાનું ચાલે છે દરદી મના કરે છે દરદી રિપોર્ટ કરે છે સંકળાયેલ લક્ષણો * હું (કાર્યકર્તા) પુષ્ટિ કરું છું કે મેં ગોપનીયતા સૂચના અને દર્દીની સંમતિ વાંચી છે. તમે કુટુંબના વડા છો? સેટઅપ માટે સક્ષમ ઇંટરનેટ જરૂરી છે જવાબ આપવાનો ઇનકાર કર્યો વહેંચતા પહેલા પ્રિસ્ક્રિપ્શન ડાઉનલોડ કરો શું તમે અથવા તમારા પરિવારનો કોઈ સભ્ય વોટ્સએપનો ઉપયોગ કરે છે? * શું તમે આ મુલાકાતને કટોકટી તરીકે સેટ કરવા માંગો છો? 10 અંકો દાખલ કરો જવાબ દાખલ કરો નંબર દાખલ કરો વ્યવસાય દાખલ કરો સમય દાખલ કરો તમે પ્રિસ્ક્રિપ્શન શેર કરવા માંગતા હો તે મોબાઇલ નંબર દાખલ કરો. તાજું કરવામાં નિષ્ફળ, તમારું ઇન્ટરનેટ કનેક્શન તપાસો. કૃપા કરીને એપ્લિકેશનને ફરીથી પ્રારંભ કરો. કુટંબનો સભ્ય઼ લિંગ ત્યાં જવા, પાણી મેળવવા અને એક જ સફરમાં પાછા આવવામાં કેટલો સમય લાગે છે? * સામાન્ય રીતે તમારા સભ્યોમાં કેટલા સભ્યો રહે છે અથવા હવે તમારી સાથે રહ્યા છે તમારા કુટુંબની કેટલી હેક્ટર ખેતીલાયક જમીન છે? * છબી સફળતાપૂર્વક સાચવવામાં આવી! માહિતી! પાછલા બે અઠવાડિયામાં, આ સ્રોતમાંથી પાણી ઓછામાં ઓછા એક સંપૂર્ણ દિવસ માટે ઉપલબ્ધ ન હતું? * " મહિના" કોઈ કુટુંબ સભ્ય નોંધાયેલ નથી મહેરબાની કરીને મોબાઇલ નંબર દાખલ કરો કૃપા કરીને પહેલા ગોપનીયતા સંમતિ વાંચો. પસંદ કરો વિશેષતા પસંદ કરો ઘરની રચના પસંદ કરો * કંઈક ખોટું થયું. કૃપા કરીને સપોર્ટનો સંપર્ક કરો ઘરના સભ્યોની કુલ સંખ્યા * પીવાના પાણીને સુરક્ષિત બનાવવા માટે તમે શું કરો છો? * તમારા ઘરના સભ્યો માટે પીવાના પાણીનો મુખ્ય સ્રોત શું છે? * તમારા વ્યવસાય શું છે?* તમે વ્યક્તિગત રીતે કયા પ્રકારનો મોબાઇલ ફોન ધરાવો છો? * તમારા ઘરના સભ્યો સામાન્ય રીતે કેવા પ્રકારની શૌચાલય સુવિધાનો ઉપયોગ કરે છે? * તમે ઇન્ટરનેટથી કનેક્ટેડ નથી. કલાક દિવસ અઠવાડિયું વર્ષ કલાક દીઠ દિવસ દીઠ સપ્તાહ દીઠ પ્રતિ મહિના પ્રતિ વર્ષ \" and I will be assisting you.\" Powered by Intelehealth, Arogya Foundation of India &\nTransform Rural India Self Assessment District* In partnership with state government of Jharkhand Madhya Pradesh Age cannot be less than 1 Age cannot be greater than 120 Date of tested positive / Days Block Take Photo Choose from Gallery Add Additional Document! Sikkim
